import React from 'react';
import Header from './Header/Header'
import './App.css';



class App extends React.Component {

  constructor(props){
    super(props);
    this.state= {date: new Date()};
  }
  render() {
    return (
      <div className="App">
        <div className="App-header">
          <div>
            <h1>Bonjour,  !</h1>
            <h2>Il est {this.state.date.toLocaleTimeString()}.</h2>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
